import styled from "styled-components";
import { ReactComponent as AssetLogo } from "./../../assets/logo.svg";

export const HeaderWrap = styled.nav`
  display: grid;
  grid-template-columns: 20% 50% 30%;
  width: 100%;
`;

export const Logo = styled(AssetLogo)`
  display: grid;
  grid-template-columns: 20% 50% 30%;
  width: 100%;
`;
